import React from 'react'
import image from '../images/card.png'
import LoginPage from '../components/LoginPage'

const Login = () => {
  return (
    <div className="Login">
      <img className="LoginImage" src={image} alt="card" /> 
      <LoginPage />
    </div>
  )
}

export default Login
